import '../../App.css';
import './Pages.css';


function Experience()
{
	return (
		<div className='contentArea'>
			<div className='container'>
				<div className='row headerRow'>
					<div className='col-md-12'>
						<h1>FY22 Financial Highlights</h1>
					</div>
				</div>
				<br/>
				<div className='row'>
				</div>
			</div>
		</div>

	);
}

export default FinancialHighlights
